import { StyledContainer } from "./styles";
import { ContainerProps } from "../types";

const Container = ({ border, backgroundImage, height, children, padding, maxWidth}: ContainerProps) => (
  <StyledContainer border={border} backgroundImage={backgroundImage} height={height} padding={padding} maxWidth={maxWidth}>{children}</StyledContainer>
);

export default Container;
